import React from 'react';
import {connect} from 'react-redux'
import './App.css';

function App(props) {
  console.log(props);
    return (
    <button onClick='this.nameChange'>change</button>


    );
}

const mapDispatchToProps=(dispatch)=>{
  return{
    changeName:(name)=>{dispatch({type:'CHANGE:NAME',payload:name})}
  }
}
const mapStateToStore=(state)=>{
  return {
    name:state.name
  }


}

export default connect(mapStateToStore,mapDispatchToProps)(App);
